import React from "react";

function Sidebar(){
    return(
        <div className="sidebar">
            <ul>
                <li>DashBoard</li>
                <li>Attendance</li>
                <li>PaySlips</li>
                <li>Leave</li>
            </ul>
        </div>
    );

}

export default Sidebar;
